import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import favicon from '../../assets/images/favicon.png'
import guser from '../../assets/images/guser.png'
import puser from '../../assets/images/puser.png'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'


const MainWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  /* align-items: center; */
  padding: 16px 0px;
  height: 100vh;
  width: 100%;
  background-color : ${properties.bgGray};
`
const SubWrapper1 = styled.div`
  width: 500px;
  height: auto;
  background-color : ${properties.bgGray};
  display: flex;
  flex-direction: column;
  align-items: center;
  @media (max-width: 500px) {
  width: 80%;
}
`
const SubCol1 = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  background-color : ${properties.bgGray};
`
const SubColLogo = styled.div`
  width: 63px;
  height: 64px;
  background-color : ${properties.bgGray};
  background-image: url(${props => props.favicon});
  background-size: cover;
`
const SubCol2 = styled.div`
  width: 300px;
  height: 50%;
  display: flex;
  flex-direction: column;
  margin: 24px ;
  padding: 0px 24px;
  padding-bottom: 24px;
  border: 1px solid rgba(0, 40, 100, 0.12);
  background-color : ${properties.white}; 
  @media (max-width: 500px) {
  width: 70%;
  margin: 12px ;
  padding: 0px 12px;
  padding-bottom: 12px;
} 
`
const Col1 = styled.div`
  padding: 24px 0px;
} 
`
const Col2 = styled.div`
  padding-bottom: 10px;
} 
`
let Input = styled.input`
border: 1px solid rgba(0, 40, 100, 0.12);
height: 38px;
width: 96%;
border-radius: 5px;
color: ${properties.littleLightGrey};
font-size: ${fSize.sMedium};
padding: 0px 0px 0px 10px;
`
const Col3 = styled.div`
height: 38px;
padding-bottom: 24px;
`
let Input2 = styled.input`
border: 1px solid rgba(0, 40, 100, 0.12);
height: 38px;
width: 96%;
border-radius: 5px;
color: ${properties.littleLightGrey};
font-size: ${fSize.sMedium};
padding: 0px 0px 0px 10px;
`
const Col4 = styled.div`
height: 38px;

`
const Col5 = styled.div`
float: right;
padding: 3px 0px 0px 0px;
`
const Col6 = styled.div`
margin-top: 20px;
width: 100%;
display: flex;
flex-direction: row;
float: left;
`
const Col7 = styled.div`
width: 100%;
`
const styles = styled.button({
  primary: {
    background: 'blue'
  },
  warning: {
    background: 'yellow'
  },
  button: {
    width: '100%'
  },
  // media queries
  // '@media (max-width: 200px)': {
  //   button: {
  //     width: '100%'
  //   }
  // }
});
// const Col8 = styled.div`
// `
class LogIn extends Component {
  render() {
    return (<div>


      <MainWrapper >
        <SubWrapper1 >
          <SubCol1>
            <SubColLogo favicon={favicon} />
          </SubCol1>
          <SubCol2>
            <form>
              <Col1>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}>
                  Login to your account
              </TextBox>
              </Col1>
              <Col2>
                <TextBox
                  ffamily={"semiBold"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.mSmall}>
                  Email address
              </TextBox>
              </Col2>
              <Col3>
                <Input placeholder="Enter Email" />
              </Col3>
              <Col2>
                <TextBox
                  ffamily={"semiBold"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.mSmall}>
                  Password
              </TextBox>
              </Col2>
              <Col4>
                <Input2 placeholder="Password" type="password" />
              </Col4>
              {/* <p>Enter your age:</p>
              <input
                type='text'
                name='age'
                // onChange={this.myChangeHandler}
              />
              {this.state.errormessage} */}
              <Col5>
                <TextBox

                  ffamily={"regular"}
                  color={properties.otherBlue}
                  fontSize={fSize.lSmall}>
                  I forgot password
              </TextBox>
              </Col5>
              <Col6>
                <input type="checkbox"/>
                <TextBox
                  ffamily={"regular"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.medium}>
                  Remember me
              </TextBox>
              </Col6>
              <Col7>
                {/* <button styled={[styles.button, styles.primary]}  > */}

                  <button> Sign in</button>
                {/* </button> */}
              </Col7>

            </form>
          </SubCol2>
        </SubWrapper1>
      </MainWrapper>


    </div >
    )
  }
}

export default LogIn
